'use strict';

Object.defineProperty(exports, Symbol.toStringTag, { value: 'Module' });

const jsxRuntime = require('react/jsx-runtime');
const CardAction = require('./CardAction.js');
const CardContext = require('./CardContext.js');
const BaseCheckbox = require('../BaseCheckbox/BaseCheckbox.js');

const CardCheckbox = (props) => {
    const { id } = CardContext.useCard();
    return (
    // @ts-expect-error styled-components can't overwrite the position prop from Stack
    jsxRuntime.jsx(CardAction.CardAction, { position: "start", children: jsxRuntime.jsx(BaseCheckbox.BaseCheckbox, { "aria-labelledby": `${id}-title`, ...props }) }));
};

exports.CardCheckbox = CardCheckbox;
